import axios from "axios";

const getPokemons = () => {
  axios
    .get(
      "https://raw.githubusercontent.com/Biuni/PokemonGO-Pokedex/master/pokedex.json"
    )
    .then(function (response) {
      return response.data.pokemon;
    });
  // .catch(function (error) {
  //   console.log(error);
  // });
};

export default getPokemons;
